import React from 'react';
import styled from 'styled-components';
import Logo from '../assets/logo/sportsee_logo.svg';

const Header = styled.header`
  height: 91px;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding-left: 30px;
  background-color: black;
`;

const MainLogo = styled.div`
  img {
    width: 178px;
    transform: translateY(1.5px);
    margin-right: 10%;
  }
`;

const Links = styled.nav`
  color: white;
  font-size: 24px;
  font-weight: 500;
  line-height: 1;
  display: flex;
  justify-content: flex-end;
  gap: 10vw;
  width: 100%;
`;

function Nav() {
  return (
    <Header>
      <MainLogo>
        <img src={Logo} alt="SportSee Logo" />
      </MainLogo>
      <Links>
        <a href="/">Accueil</a>
        <a href="/">Profil</a>
        <a href="/">Réglage</a>
        <a href="/">Communauté</a>
      </Links>
    </Header>
  );
}

export default Nav;
